def transform(sequence):
    transformed_seq = ''
    for i in range(len(sequence)):
        if sequence[i] == '3':
            if i == 0 or sequence[i-1] != '3':
                transformed_seq += '2'
            else:
                transformed_seq += '3'
        else:
            transformed_seq += sequence[i]
    return transformed_seq

def transform(sequence):
    new_sequence = ''
    for digit in sequence:
        if digit == '3':
            new_sequence += '2'
        else:
            new_sequence += digit
    return new_sequence
